from typing import List

class Solution:
    def countSubarrays(self, nums: List[int], k: int) -> int:
        max_val = max(nums)
        count, left = 0, 0
        freq = 0

        for right in range(len(nums)):
            if nums[right] == max_val:
                freq += 1
            while freq > k:
                if nums[left] == max_val:
                    freq -= 1
                left += 1
            if freq == k:
                prev = left
                while left <= right and freq == k:
                    if nums[left] == max_val:
                        freq -= 1
                    left += 1
                count += left - prev
                for i in range(prev, left):
                    if nums[i] == max_val:
                        freq += 1
                        break

        return count
